CheckoutFormScreenManager.query:
query CheckoutFormScreenManager($params: PurchasableOfferParams!, $tagBindings: [OfferTagBindingInput!], $giftRecipientIDs: [ID!], $quantity: Int!, $paymentSession: PaymentSession!, $withDiscounts: Boolean, $isDarkMode: Boolean, $referrerData: SubscriptionReferrerData, $inputAmount: MoneyInput, $xsollaInputAmount: XsollaMoneyInput, $benefitsStartTime: Time) {
  purchasableOffer(params: $params) {
    listing {
      chargeModel {
        internal {
          self {
            checkoutPrice(quantity: $quantity, paymentProvider: RECURLY, userInputTotal: $inputAmount, anticipatedChargeDate: $benefitsStartTime) {
              errorCode
              checkoutPriceSummary {
                currency
                exponent
                id
                isTaxInclusive
                price
                tax
                total
                wasPriceAdjusted
                discount @include(if: $withDiscounts) {
                  price
                  total
                  tax
                }
              }
              checkoutFuturePriceSummary {
                effectiveDate
                price {
                  id
                  currency
                  price
                }
              }
            }
            checkoutPrice(quantity: $quantity, paymentProvider: XSOLLA_V3, userInputTotal: $inputAmount, anticipatedChargeDate: $benefitsStartTime) {
              errorCode
              checkoutPriceSummary {
                currency
                exponent
                id
                isTaxInclusive
                price
                tax
                total
                wasPriceAdjusted
                discount @include(if: $withDiscounts) {
                  price
                  total
                  tax
                }
              }
              checkoutFuturePriceSummary {
                effectiveDate
                price {
                  id
                  currency
                  price
                }
              }
            }
          }
          plan {
            renewalPolicy
            interval {
              duration
              unit
            }
          }
          previewPrice(selectionProcess: DEEP_PREFER_RECURLY) {
            currency
            exponent
            id
            isTaxInclusive
            price
            tax
            discount @include(if: $withDiscounts) {
              price
            }
          }
        }
      }
    }
    eligibility {
      isEligible
      purchaseType
      reasonCode
      benefitsStartAt
    }
    endAt
    giftType
    id
    quantity {
      min
      max
    }
    self {
      checkoutActions(quantity: $quantity, paymentSession: $paymentSession, inputAmount: $inputAmount)
      promoActions(paymentSession: $paymentSession)
      eligiblePaymentMethods {
        ...eligiblePaymentMethodFragment
      }
      checkoutConfiguration {
        xsolla(offerTagBindings: $tagBindings, quantity: $quantity, giftRecipientIDs: $giftRecipientIDs, paymentSession: $paymentSession, isDarkMode: $isDarkMode, referrerData: $referrerData, userInputTotal: $xsollaInputAmount) {
          token
          isSandbox
          ineligibilityReason
          error
        }
      }
    }
    tplr
    tagBindings {
      key
      value
    }
    promotion @include(if: $withDiscounts) {
      id
      name
      promoDisplay {
        discountPercent
        discountType
      }
      endAt
    }
  }
  currentUser {
    id
    email
    displayName
    paymentMethods(includeSubs: false, recurlyOnly: true) {
      ...paymentMethodFragment
    }
    residence {
      ...userResidenceFragment
    }
    purchaseOrderCount
    accountHealth {
      isVerifiedEmail
      isPhoneNumberVerified
    }
  }
  requestInfo {
    countryCode
  }
  recurlyConfigs {
    payWithAmazonConfigs {
      clientID
      isProduction
      sellerID
    }
    braintreeClientAuthorization
    publicKey
  }
}

