ViewerCardModLogs.query:
query ViewerCardModLogs($channelID: ID!, $channelLogin: String!, $targetID: ID!) {
  user(id: $targetID) {
    id
    login
  }
  user(login: $channelLogin) {
    id
    login
  }
  currentUser {
    login
    id
  }
  viewerCardModLogs(channelID: $channelID, targetID: $targetID) {
    messages(first: 1000, excludeModActions: true) {
      ... on ViewerCardModLogsMessagesError {
        code
      }
      ... on ViewerCardModLogsMessagesConnection {
        pageInfo {
          hasNextPage
        }
        count
      }
    }
    targetedActions(first: 99, type: BAN) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: TIMEOUT) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: UNBAN) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: UNTIMEOUT) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: UNBAN_REQUEST_APPROVED) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: UNBAN_REQUEST_DENIED) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: WARN) {
      ...modLogsTargetedActionsResultFragment
    }
    targetedActions(first: 99, type: ACKNOWLEDGE_WARNING) {
      ...modLogsTargetedActionsResultFragment
    }
  }
}

fragment modLogsTargetedActionsResultFragment on ModLogsTargetedActionsResult {
  __typename
  ... on ModLogsTargetedActionsError {
    code
  }
  ... on ModLogsTargetedActionsConnection {
    count
    pageInfo {
      hasNextPage
    }
    edges {
      cursor
      node {
        ...modLogsTargetedActionFragment
      }
    }
  }
}

