  video(id: $vodID) @include(if: $isVOD) {
    id
    broadcastType
    owner {
      ...VODMidrollManagerBroadcaster
    }
  }
  collection(id: $collectionID) @include(if: $isCollection) {
    id
    items(first: 1) {
      edges {
        node {
          ... on Video {
            id
            broadcastType
          }
        }
      }
    }
    owner {
      ...VODMidrollManagerBroadcaster
    }
  }
}

