PlayerTrackingContextQuery.query:
query PlayerTrackingContextQuery($channel: String, $isLive: Boolean!, $collectionID: ID!, $hasCollection: Boolean!, $videoID: ID!, $hasVideo: Boolean!, $slug: ID!, $hasClip: Boolean!) {
  currentUser {
    id
    login
    isStaff
    hasTurbo
  }
  user(login: $channel) @include(if: $isLive) {
    id
    ...PlayerTrackingBroadcaster
    subscriptionProducts {
      id
      hasAdFree
    }
    stream {
      id
      broadcasterSoftware
      game {
        ...PlayerTrackingGame
      }
      restriction {
        id
        options
        type
        exemptions {
          type
        }
      }
    }
    self {
      follower {
        followedAt
      }
      subscriptionBenefit {
        id
      }
      isModerator
    }
    broadcastSettings {
      id
      game {
        ...PlayerTrackingGame
      }
    }
  }
  collection(id: $collectionID) @include(if: $hasCollection) {
    id
    items(first: 200) {
      edges {
        node {
          ...PlayerTrackingVOD
        }
      }
    }
    owner {
      id
      ...PlayerTrackingBroadcaster
    }
  }
  video(id: $videoID) @include(if: $hasVideo) {
    id
    ...PlayerTrackingVOD
    owner {
      ...PlayerTrackingBroadcaster
    }
  }
  clip(slug: $slug) @include(if: $hasClip) {
    id
    broadcaster {
      ...PlayerTrackingBroadcaster
    }
    game {
      ...PlayerTrackingGame
    }
  }
}

fragment PlayerTrackingVOD on Video {
  id
  broadcastType
  game {
    id
    name
  }
}

