ActivityListContextV2Query.query:
fragment activityFeedEmote on Emote {
  id
  token
  setID
  modifiers {
    code
    name
  }
  type
  assetType
}

fragment activityFeedCheermote on ActivityFeedCheermote {
  prefix
  bitsAmount
  tier
}

fragment activityFeedUser on User {
  id
  displayName
  login
}

fragment activityFeedTokens on ActivityFeedText {
  fragments {
    token {
      ... on ActivityFeedTextToken {
        text
      }
      ... on ActivityFeedIntegerToken {
        number
      }
      ... on ActivityFeedPercentToken {
        percent
      }
      ... on User {
        ...activityFeedUser
      }
      ... on Emote {
        ...activityFeedEmote
      }
      ...activityFeedCheermote
      ... on UserDoesNotExist {
        key
      }
      ... on UserError {
        key
      }
    }
    hasEmphasis
  }
}

fragment crowdControlPurchase on CrowdControlPurchase {
  value
  unit
}

fragment crowdControlAlert on ActivityFeedCrowdControlAlert {
  type
  data {
    ... on CrowdControlEffectData {
      thirdPartyHandle
      itemName
      purchase {
        ...crowdControlPurchase
      }
    }
    ... on CrowdControlExchangeData {
      thirdPartyHandle
      itemName
      purchase {
        ...crowdControlPurchase
      }
      exchangeValue
    }
    ... on CrowdControlPoolData {
      itemName
      poolPercentage
    }
  }
}

fragment streamElementsAlert on ActivityFeedStreamElementsAlert {
  type
  data {
    ... on StreamElementsMerchData {
      thirdPartyHandle
      message
      itemName
    }
  }
}

fragment streamLabsAlert on ActivityFeedStreamLabsAlert {
  type
  data {
    ... on StreamLabsTipData {
      thirdPartyHandle
      message
      money {
        amount
        currencyCode
        minorUnits
      }
    }
    ... on StreamLabsMediaData {
      thirdPartyHandle
      itemName
      message
      money {
        amount
        currencyCode
        minorUnits
      }
    }
    ... on StreamLabsMerchData {
      thirdPartyHandle
      itemName
      message
    }
    ... on StreamLabsCharityDonationData {
      thirdPartyHandle
      message
      charityName
      money {
        amount
        currencyCode
        minorUnits
      }
    }
  }
}

fragment throneAlert on ActivityFeedThroneAlert {
  type
  data {
    ... on ThroneGiftData {
      type
      thirdPartyHandle
      message
      itemName
      link
    }
    ... on ThroneContributionPurchasedData {
      thirdPartyHandle
      itemName
      money {
        amount
        currencyCode
        minorUnits
      }
      link
    }
    ... on ThroneBadgeEarnedData {
      itemName
      itemDescription
      link
    }
  }
}

fragment AlertMessageContent on ActivityFeedAlertMessageContent {
  fragments {
    __typename
    ... on ActivityFeedAlertMessageTextFragment {
      text
    }
    ... on ActivityFeedAlertMessageEmoteFragment {
      emote {
        ...activityFeedEmote
      }
    }
    ... on ActivityFeedAlertMessageCheermoteFragment {
      cheermote {
        ...activityFeedCheermote
      }
    }
    ... on ActivityFeedAlertMessageEmoteNotFound {
      emoteID
    }
  }
}

fragment BitsSpendFeatureData on BitsSpendAlertData {
  ... on BitsSpendCheerData {
    messageContent {
      ...AlertMessageContent
    }
    isFirstTimeCheer
  }
  ... on BitsSpendAutomaticPowerUpData {
    messageContent {
      ...AlertMessageContent
    }
    reward {
      powerUpType
    }
  }
}

fragment alertEvent on ActivityFeedAlert {
  __typename
  id
  status
  createdAt
  updatedAt
  testVariant
  ... on ActivityFeedCheerAlert {
    cheerer {
      ...activityFeedUser
    }
    amount
    isAnonymous
    isFirstTimeCheer
    messageContent {
      ...AlertMessageContent
    }
  }
  ... on ActivityFeedBitsSpendAlert {
    fromUser {
      ...activityFeedUser
    }
    bitsAmount
    featureType
    featureData {
      ...BitsSpendFeatureData
    }
  }
